INSERT INTO "Clinics" ("id", "name", "address", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(13, 'Bệnh viện Chợ Rẫy', '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', '<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>', 'Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.', 'data:image/jpeg;base64,', '2024-07-15 21:05:43', '2024-07-15 21:05:43');
INSERT INTO "Clinics" ("id", "name", "address", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(14, 'Bệnh viện nhiệt đới', '429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh ', '<p>Bệnh viện nhiệt đới mang trong mình sứ mệnh cung cấp dịch vụ đánh giá sức khoẻ toàn diện, đồng thời đảm bảo rằng các dịch vụ diễn ra nhanh chóng, tiện lợi và tiết kiệm với mọi người. Chúng tôi không ngừng nâng cao chất lượng, đảm bảo mỗi lần đánh giá sức khoẻ không chỉ giúp phát hiện bệnh sớm mà còn là cơ sở để mỗi người dân có cuộc sống lâu dài và khoẻ mạnh.</p>', 'Bệnh viện nhiệt đới mang trong mình sứ mệnh cung cấp dịch vụ đánh giá sức khoẻ toàn diện, đồng thời đảm bảo rằng các dịch vụ diễn ra nhanh chóng, tiện lợi và tiết kiệm với mọi người. Chúng tôi không ngừng nâng cao chất lượng, đảm bảo mỗi lần đánh giá sức khoẻ không chỉ giúp phát hiện bệnh sớm mà còn là cơ sở để mỗi người dân có cuộc sống lâu dài và khoẻ mạnh.', 'data:image/jpeg;base64,', '2024-07-15 21:07:42', '2024-07-15 21:07:42');
INSERT INTO "Clinics" ("id", "name", "address", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(15, 'Bệnh viện Tâm Anh', 'Số 1B Trần Hưng Đạo, Quận Hai Bà Trưng, Hà Nội', '<p>Bệnh viện Tâm Anh là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.</p>', 'Bệnh viện Tâm Anh là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.', 'data:image/webp;base64,', '2024-07-15 21:09:01', '2024-07-15 21:09:01');
INSERT INTO "Clinics" ("id", "name", "address", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(16, 'Bệnh viện Đa khoa Thiện Hạnh', '20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM', '<p>Bệnh viện Đa khoa Thiện Hạnh được Bộ Y tế thẩm định và cấp phép hoạt động từ đầu năm 2007. Bệnh viện Thiện Hạnh  quy tụ đội ngũ giáo sư, bác sĩ đầu ngành có chuyên môn cao và giàu kinh nghiệm. Hầu hết các y, bác sĩ đang làm việc tại đây đều là những người đã và đang công tác tại các bệnh viện lớn tuyến Trung ương như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện E Hà Nội, Bệnh viện K, Bệnh viện TW Quân đội 108, Bệnh viện Phụ sản TW,…</p>', 'Bệnh viện Đa khoa Thiện Hạnh được Bộ Y tế thẩm định và cấp phép hoạt động từ đầu năm 2007. Bệnh viện Thiện Hạnh  quy tụ đội ngũ giáo sư, bác sĩ đầu ngành có chuyên môn cao và giàu kinh nghiệm. Hầu hết các y, bác sĩ đang làm việc tại đây đều là những người đã và đang công tác tại các bệnh viện lớn tuyến Trung ương như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện E Hà Nội, Bệnh viện K, Bệnh viện TW Quân đội 108, Bệnh viện Phụ sản TW,…', 'data:image/jpeg;base64,', '2024-07-15 21:12:42', '2024-07-15 21:12:42');
INSERT INTO "Clinics" ("id", "name", "address", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(17, 'Bệnh viện Đa khoa Phương Đông', 'Số 52 Nguyễn Chí Thanh - Đống Đa - Hà Nội', '<p>Bệnh viện STO Phương Đông là bệnh viện chữa bệnh ngoại khoa và chấn thương chỉnh hình uy tín tại Thành phố Hồ Chí Minh. Bệnh viện là nơi cung cấp các dịch vụ y tế chất lượng cao và đạt tiêu chuẩn quốc tế. Bệnh viện STO Phương Đông là nơi công tác của nhiều bác sĩ giỏi và có nhiều kinh nghiệm trong nghề. Đội ngũ bác sĩ của bệnh viện luôn trau dồi kiến thức y khoa, cập nhật những phương pháp mới và ứng dụng thành công trong việc điều trị bệnh.</p>', 'Bệnh viện STO Phương Đông là bệnh viện chữa bệnh ngoại khoa và chấn thương chỉnh hình uy tín tại Thành phố Hồ Chí Minh. Bệnh viện là nơi cung cấp các dịch vụ y tế chất lượng cao và đạt tiêu chuẩn quốc tế. Bệnh viện STO Phương Đông là nơi công tác của nhiều bác sĩ giỏi và có nhiều kinh nghiệm trong nghề. Đội ngũ bác sĩ của bệnh viện luôn trau dồi kiến thức y khoa, cập nhật những phương pháp mới và ứng dụng thành công trong việc điều trị bệnh.', 'data:image/jpeg;base64,', '2024-07-15 21:15:14', '2024-07-15 21:15:14');
