INSERT INTO "Markdowns" ("id", "contentHTML", "contentMarkdown", "description", "doctorId", "specialtyId", "clinicId", "createdAt", "updatedAt") VALUES
(5, '<h5>Thạc sĩ Bác sĩ Nguyễn Thành</h5><ul><li><p>Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần</p></li><li><p>Hiện đang công tác tại Bệnh viện Đại Học Y Dược TP. HCM</p></li><li><p>Giảng viên tại Đại Học Y Dược TP. HCM</p></li><li><p>Bác sĩ nhận khám từ 10 tuổi trở lên</p></li></ul><h5>Khám và điều trị</h5><p>Bác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:</p><ul><li><p>Mất ngủ và các rối loạn liên quan giấc ngủ: không ngủ được, ngủ ít, khó vào giấc ngủ, ngủ không sâu, không thẳng giấc, nằm mơ, ngủ nhiều</p></li><li><p>Trầm cảm và các rối loạn liên quan: khí sắc trầm, buồn, cảm giác chán nản, trống rỗng, mất hứng thú, hay khóc, giảm ngon miệng, mất ngủ hoặc ngủ nhiều, chậm chạp, bứt rứt, mệt mỏi, dễ cáu gắt, giảm tập trung suy nghĩ, thiếu quyết đoán, cảm giác vô dụng, hay tự trách móc, mặc cảm tội lỗi, hay nghĩ đến cái chết, muốn tự sát,...</p></li><li><p>Hưng cảm: dễ bực tức, tự đánh giá cao bản thân, ý tưởng tự cao, giảm nhu cầu ngủ, nói nhiều, đãng trí, tiêu tiền hoang phí, đầu tư thương mại không hợp lý, quan hệ tình dục bừa bãi, kích động,...</p></li><li><p>Lo âu và các rối loạn liên quan: lo âu hay bận tâm quá mức về một vài việc trong cuộc sống, dễ bực tức, cáu gắt, mệt mỏi, hay suy nghĩ quá mức hoặc về những việc không cần thiết, khó tập trung, hay quên, rối loạn giấc ngủ,...</p></li><li><p>Rối loạn triệu chứng cơ thể và các rối loạn liên quan: thường xuyên có 1 số các triệu chứng sau: đau đầu, đau tay chân, đau lưng, đau khớp, đau ngực, đau trực tràng,…; buồn nôn, đầy hơi, nôn mửa, tiêu chảy; mất hứng thú tình dục, bất thường cương dương hay phóng tinh,...; rối loạn vận động hay thăng bằng, liệt hay yếu cơ khu trú, khó nuốt hay cảm giác hòn cục trong họng, tê, mất cảm giác, nhìn đôi, co giật, muốn ngất,... đã thăm khám nhiều nơi mà chưa tìm ra nguyên nhân tương ứng, bệnh tái đi tái lại</p></li><li><p>Các rối loạn liên quan loạn thần: ảo thanh nghe có người nói chuyện với mình, bình phẩm mình, đe dọa mình, ra lệnh cho mình,…; hoang tưởng tự cao, phát minh, bị theo dõi, bị hại, bị nhập,…; nói một mình, trì trệ, chậm chạp, ăn mặc lôi thôi, có hành vi kỳ dị hoặc các cơn xung động đập phá, tấn công người xung quanh, tự gây thương tích cho bản thân hoặc tự sát,...</p></li><li><p>Sa sút tâm thần: mất khả năng học thông tin mới và khó khăn trong việc gợi lại trí nhớ (quên), rối loạn ngôn ngữ (nói vòng vo, lời trống rỗng, vô nghĩa), thờ ơ, dễ kích động, rối loạn giấc ngủ,…</p></li><li><p>Các rối loạn liên quan 1 chất: rượu, chất gây nghiện, thuốc gây nghiện,…</p></li><li><p>Các rối loạn tâm lý, hành vi và ứng xử khác,…</p></li></ul><h5>Quá trình công tác</h5><ul><li><p>Hiện đang công tác tại Bệnh viện Đại Học Y Dược TP. HCM</p></li><li><p>Giảng viên tại Đại Học Y Dược TP. HCM</p></li></ul>', '##### Thạc sĩ Bác sĩ Nguyễn Thành* Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần* Hiện đang công tác tại Bệnh viện Đại Học Y Dược TP. HCM* Giảng viên tại Đại Học Y Dược TP. HCM* Bác sĩ nhận khám từ 10 tuổi trở lên#####  Khám và điều trịBác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:* Mất ngủ và các rối loạn liên quan giấc ngủ: không ngủ được, ngủ ít, khó vào giấc ngủ, ngủ không sâu, không thẳng giấc, nằm mơ, ngủ nhiều* Trầm cảm và các rối loạn liên quan: khí sắc trầm, buồn, cảm giác chán nản, trống rỗng, mất hứng thú, hay khóc, giảm ngon miệng, mất ngủ hoặc ngủ nhiều, chậm chạp, bứt rứt, mệt mỏi, dễ cáu gắt, giảm tập trung suy nghĩ, thiếu quyết đoán, cảm giác vô dụng, hay tự trách móc, mặc cảm tội lỗi, hay nghĩ đến cái chết, muốn tự sát,...* Hưng cảm: dễ bực tức, tự đánh giá cao bản thân, ý tưởng tự cao, giảm nhu cầu ngủ, nói nhiều, đãng trí, tiêu tiền hoang phí, đầu tư thương mại không hợp lý, quan hệ tình dục bừa bãi, kích động,...* Lo âu và các rối loạn liên quan: lo âu hay bận tâm quá mức về một vài việc trong cuộc sống, dễ bực tức, cáu gắt, mệt mỏi, hay suy nghĩ quá mức hoặc về những việc không cần thiết, khó tập trung, hay quên, rối loạn giấc ngủ,...* Rối loạn triệu chứng cơ thể và các rối loạn liên quan: thường xuyên có 1 số các triệu chứng sau: đau đầu, đau tay chân, đau lưng, đau khớp, đau ngực, đau trực tràng,…; buồn nôn, đầy hơi, nôn mửa, tiêu chảy; mất hứng thú tình dục, bất thường cương dương hay phóng tinh,...; rối loạn vận động hay thăng bằng, liệt hay yếu cơ khu trú, khó nuốt hay cảm giác hòn cục trong họng, tê, mất cảm giác, nhìn đôi, co giật, muốn ngất,... đã thăm khám nhiều nơi mà chưa tìm ra nguyên nhân tương ứng, bệnh tái đi tái lại* Các rối loạn liên quan loạn thần: ảo thanh nghe có người nói chuyện với mình, bình phẩm mình, đe dọa mình, ra lệnh cho mình,…; hoang tưởng tự cao, phát minh, bị theo dõi, bị hại, bị nhập,…; nói một mình, trì trệ, chậm chạp, ăn mặc lôi thôi, có hành vi kỳ dị hoặc các cơn xung động đập phá, tấn công người xung quanh, tự gây thương tích cho bản thân hoặc tự sát,...* Sa sút tâm thần: mất khả năng học thông tin mới và khó khăn trong việc gợi lại trí nhớ (quên), rối loạn ngôn ngữ (nói vòng vo, lời trống rỗng, vô nghĩa), thờ ơ, dễ kích động, rối loạn giấc ngủ,…* Các rối loạn liên quan 1 chất: rượu, chất gây nghiện, thuốc gây nghiện,… * Các rối loạn tâm lý, hành vi và ứng xử khác,…#####  Quá trình công tác* Hiện đang công tác tại Bệnh viện Đại Học Y Dược TP. HCM* Giảng viên tại Đại Học Y Dược TP. HCM', 'Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thầnHiện đang công tác tại Bệnh viện Đại Học Y Dược TP. HCM, Giảng viên tại Đại Học Y Dược TP. HCMBác sĩ nhận khám từ 10 tuổi trở lên ', 9, NULL, NULL, '2024-07-09 10:02:00', '2024-07-10 14:43:59'),
(7, '<h5>Bác sĩ Chuyên khoa I Lê Tiến</h5><ul><li>Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần</li><li>Hiện đang công tác tại Bệnh viện Tâm thần TP. HCM</li><li>Thực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp</li><li>Bác sĩ nhận khám từ 10 tuổi trở lên</li></ul><h5>Khám và điều trị</h5><p>Bác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:</p><ul><li>Các rối loạn tâm thần cấp tính do stress, do nghiện chất (chất kích thích, ma túy, rượu), tâm thần phân liệt, do bệnh động kinh</li><li>Các rối loạn cảm xúc như trầm cảm, hưng cảm, rối loạn lưỡng cực</li><li>Rối loạn giấc ngủ</li><li>Mất ngủ</li><li>Rối loạn stress</li><li>Sang chấn sau stress</li><li>Đau đầu do căng thẳng</li><li>Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ</li></ul><h5>Quá trình công tác</h5><ul><li>Công tác tại phòng Kế hoạch tổng hợp, Bệnh viện Tâm thần TP. HCM (2004 - nay)</li><li>Quản lý chương trình quốc gia tâm thần và động kinh 24 quận - huyện thuộc TP. HCM</li><li>Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ ở các trường khuyết tật</li><li>Khám sức khỏe tâm thần cho các trung tâm cai nghiện</li></ul><h3>Quá trình đào tạo</h3><ul><li>Bác sĩ Chuyên khoa I ngành Tâm thần, Đại học Y dược TP. HCM (2010 - 2012)</li><li>Thực tập chương trình FFI (Faisant fonction d’interne) chuyên ngành Tâm thần tại Bệnh viện TENON quận 20, Cộng hòa Pháp (2007 - 2008)</li><li>Bác sĩ Y khoa, Trường Đại học Y khoa Phạm Ngọc Thạch (1998 - 2004)</li></ul><h5>Sách, các công trình nghiên cứu và báo cáo khoa học</h5><p>Các nghiên cứu khoa học đã tham gia:</p><ul><li>Tuân thủ điều trị thuốc của bệnh nhân tâm thần phân liệt đang điều trị tại cộng đồng TP. HCM (2016 - 2017)</li><li>Khảo sát hiệu quả liệu pháp gia đình trên bệnh nhân tâm thần phân liệt tại cộng đồng TP. HCM (2014 - 2015)</li><li>Nghiên cứu các rối loạn tâm thần trên bệnh nhân động kinh cơn lớn đang điều trị tại cộng đồng TP. HCM (2013)</li><li>Khảo sát khoảng thời gian loạn thần không điều trị (DUP) và các yếu tố liên quan trên bệnh nhân loạn thần đến khám tại Bệnh viện Tâm thần TP. HCM (2011 - 2012)</li><li>Khảo sát phản ứng tâm lý bệnh nhân tâm thần phân liệt đối với các định kiến xã hội tại TP. HCM (2006)</li></ul>', '##### Bác sĩ Chuyên khoa I Lê Tiến* Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần* Hiện đang công tác tại Bệnh viện Tâm thần TP. HCM* Thực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp* Bác sĩ nhận khám từ 10 tuổi trở lên##### Khám và điều trịBác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:* Các rối loạn tâm thần cấp tính do stress, do nghiện chất (chất kích thích, ma túy, rượu), tâm thần phân liệt, do bệnh động kinh* Các rối loạn cảm xúc như trầm cảm, hưng cảm, rối loạn lưỡng cực* Rối loạn giấc ngủ* Mất ngủ* Rối loạn stress* Sang chấn sau stress* Đau đầu do căng thẳng* Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ##### Quá trình công tác* Công tác tại phòng Kế hoạch tổng hợp, Bệnh viện Tâm thần TP. HCM (2004 - nay)* Quản lý chương trình quốc gia tâm thần và động kinh 24 quận - huyện thuộc TP. HCM* Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ ở các trường khuyết tật* Khám sức khỏe tâm thần cho các trung tâm cai nghiện### Quá trình đào tạo* Bác sĩ Chuyên khoa I ngành Tâm thần, Đại học Y dược TP. HCM (2010 - 2012)* Thực tập chương trình FFI (Faisant fonction d’interne) chuyên ngành Tâm thần tại Bệnh viện TENON quận 20, Cộng hòa Pháp (2007 - 2008)* Bác sĩ Y khoa, Trường Đại học Y khoa Phạm Ngọc Thạch (1998 - 2004)##### Sách, các công trình nghiên cứu và báo cáo khoa họcCác nghiên cứu khoa học đã tham gia:* Tuân thủ điều trị thuốc của bệnh nhân tâm thần phân liệt đang điều trị tại cộng đồng TP. HCM (2016 - 2017)* Khảo sát hiệu quả liệu pháp gia đình trên bệnh nhân tâm thần phân liệt tại cộng đồng TP. HCM (2014 - 2015)* Nghiên cứu các rối loạn tâm thần trên bệnh nhân động kinh cơn lớn đang điều trị tại cộng đồng TP. HCM (2013)* Khảo sát khoảng thời gian loạn thần không điều trị (DUP) và các yếu tố liên quan trên bệnh nhân loạn thần đến khám tại Bệnh viện Tâm thần TP. HCM (2011 - 2012)* Khảo sát phản ứng tâm lý bệnh nhân tâm thần phân liệt đối với các định kiến xã hội tại TP. HCM (2006)', 'Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thầnHiện đang công tác tại Bệnh viện Tâm thần TP. HCMThực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa PhápBác sĩ nhận khám từ 10 tuổi trở lên ', 8, NULL, NULL, '2024-07-10 14:38:12', '2024-07-10 14:44:17'),
(8, '<h5>Thạc sĩ, Bác sĩ Như Quỳnh</h5><ul><li>Bác sĩ tư vấn dinh dưỡng cho phụ nữ mang thai và trẻ em</li><li>Nhiều năm kinh nghiệm trong lĩnh vực Tư vấn dinh dưỡng</li></ul><h5>Khám và điều trị</h5><ul><li>Tư vấn dinh dưỡng cho phụ nữ mang thai, phụ nữ sau sinh</li><li>Tư vấn dinh dưỡng cho trẻ từ 0 – 5 tuổi, giai đoạn sơ sinh, ăn dặm</li><li>Tư vấn dinh dưỡng cho phụ nữ mắc đái tháo đường thai kỳ, tăng/sụt cân trong thời kỳ mang thai, thiếu vi chất…</li></ul><h5>Quá trình công tác</h5><ul><li>Hiện là Bác sĩ khám và điều trị, Bệnh viện Đa khoa Bảo Sơn</li></ul><h5>Quá trình đào tạo</h5><ul><li>Tốt nghiệp Bác sĩ Đa khoa, Đại học Y Hà Nội</li><li>Chứng chỉ Dinh dưỡng lâm sàng và điều trị, Viện dinh dưỡng quốc gia</li></ul>', '##### Thạc sĩ, Bác sĩ Như Quỳnh* Bác sĩ tư vấn dinh dưỡng cho phụ nữ mang thai và trẻ em* Nhiều năm kinh nghiệm trong lĩnh vực Tư vấn dinh dưỡng##### Khám và điều trị* Tư vấn dinh dưỡng cho phụ nữ mang thai, phụ nữ sau sinh* Tư vấn dinh dưỡng cho trẻ từ 0 – 5 tuổi, giai đoạn sơ sinh, ăn dặm* Tư vấn dinh dưỡng cho phụ nữ mắc đái tháo đường thai kỳ, tăng/sụt cân trong thời kỳ mang thai, thiếu vi chất…##### Quá trình công tác* Hiện là Bác sĩ khám và điều trị, Bệnh viện Đa khoa Bảo Sơn##### Quá trình đào tạo* Tốt nghiệp Bác sĩ Đa khoa, Đại học Y Hà Nội* Chứng chỉ Dinh dưỡng lâm sàng và điều trị, Viện dinh dưỡng quốc gia', 'Bác sĩ tư vấn dinh dưỡng cho phụ nữ mang thai và trẻ emNhiều năm kinh nghiệm trong lĩnh vực Tư vấn dinh dưỡng', 7, NULL, NULL, '2024-07-10 14:40:34', '2024-07-10 14:43:25'),
(10, '<h5>Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Việt Anh</h5><ul><li>Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu</li><li>Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương</li><li>Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương</li><li>Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan</li><li>Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu</li><li>Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới</li><li>Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội</li><li>Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ</li><li>Tốt nghiệp Đại học Y Hà Nội (1977)</li><li>Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam</li></ul><h5>Phó Giáo sư khám và điều trị</h5><p>Các bệnh lý về chuyên sâu về da liễu người lớn và trẻ em</p><ul><li>Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)</li><li>Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá</li><li>Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da</li><li>Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm</li><li>Viêm da cơ địa trẻ em và người lớn</li><li>Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu</li><li>Tổ đỉa</li><li>Mày đay</li><li>Bạch biến</li><li>Vảy nến</li><li>Rụng tóc</li><li>Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ</li><li>Zona, Thủy đậu, Herpes</li><li>Ghẻ</li><li>Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc</li><li>Viêm mao mạch dị ứng</li><li>các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc</li><li>U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã</li><li>Một số bệnh lông - tóc - móng</li><li>Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi</li><li>Tiêm tái sinh nang tóc</li></ul><h5>Và các bệnh lý chuyên sâu khác về chuyên khoa Da liễu</h5>', '##### Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Việt Anh* Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu* Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương* Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương* Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan* Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu* Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới* Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội* Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ* Tốt nghiệp Đại học Y Hà Nội (1977)* Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam##### Phó Giáo sư khám và điều trịCác bệnh lý về chuyên sâu về da liễu người lớn và trẻ em* Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)* Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá* Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da* Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm* Viêm da cơ địa trẻ em và người lớn* Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu* Tổ đỉa* Mày đay* Bạch biến* Vảy nến* Rụng tóc* Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ* Zona, Thủy đậu, Herpes* Ghẻ* Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc* Viêm mao mạch dị ứng* các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc* U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã* Một số bệnh lông - tóc - móng* Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi* Tiêm tái sinh nang tóc##### Và các bệnh lý chuyên sâu khác về chuyên khoa Da liễu', 'Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ươngBác sĩ từng công tác tại Bệnh viện Da liễu Trung ươngNguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam', 6, NULL, NULL, '2024-07-10 14:50:22', '2024-07-10 14:50:22'),
(11, '<h5>Phó Giáo sư, Tiến sĩ, Bác sĩ Hà Vi</h5><ul><li>Phó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng</li><li>Nguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương</li><li>Trên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương</li><li>Bác sĩ Nội trú chuyên ngành Tai Mũi Họng</li><li>Bác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng</li></ul><h5>Khám &amp; điều trị</h5><ul><li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn</li><li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em</li><li>Nội soi Tai Mũi Họng</li><li>Thực hiện các qui trình kỹ thuật Tai Mũi Họng</li></ul><h6>Các bệnh về tai</h6><ul><li>Ù tai, nghe kém, điếc đột ngột</li><li>Chẩy mủ tai, viêm tai giữa cấp, mạn</li><li>Vá màng nhĩ nội soi</li><li>Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài</li></ul><h6>Các bệnh mũi xoang</h6><ul><li>Viêm mũi xoang dị ứng, viêm mũi vận mạch</li><li>Viêm mũi ngạt tắc mũi mạn tính</li><li>Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang</li><li>Nấm mũi xoang</li><li>Đau đầu mạn tính do mũi xoang…</li></ul><h6>Các bệnh về họng thanh quản</h6><ul><li>Ở trẻ em viêm VA, viêm mũi họng mạn tính</li><li>Các biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)</li><li>Viêm amiđan cấp, mạn</li><li>Nạo V.A</li><li>Cắt Amidan</li></ul>', '##### Phó Giáo sư, Tiến sĩ, Bác sĩ Hà Vi* Phó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng* Nguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương* Trên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương* Bác sĩ Nội trú chuyên ngành Tai Mũi Họng* Bác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng##### Khám & điều trị* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em* Nội soi Tai Mũi Họng* Thực hiện các qui trình kỹ thuật Tai Mũi Họng###### Các bệnh về tai* Ù tai, nghe kém, điếc đột ngột* Chẩy mủ tai, viêm tai giữa cấp, mạn* Vá màng nhĩ nội soi* Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài###### Các bệnh mũi xoang* Viêm mũi xoang dị ứng, viêm mũi vận mạch* Viêm mũi ngạt tắc mũi mạn tính* Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang* Nấm mũi xoang* Đau đầu mạn tính do mũi xoang…###### Các bệnh về họng thanh quản* Ở trẻ em viêm VA, viêm mũi họng mạn tính* Các biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)* Viêm amiđan cấp, mạn* Nạo V.A* Cắt Amidan', 'Nguyên Trưởng khoa Tai mũi họng trẻ em, Bệnh viện Tai Mũi Họng Trung ươngTrên 25 năm công tác tại Bệnh viện Tai mũi họng Trung ươngChuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn và trẻ em', 5, NULL, NULL, '2024-07-10 14:54:23', '2024-07-10 14:54:23'),
(12, '<h5>Thạc sĩ, Bác sĩ Ngọc Mai</h5><ul><li>Phó Giám đốc, Trưởng khoa Hỗ trợ Sinh sản Bệnh viện Nam học và Hiếm muộn Hà Nội</li><li>Hơn 10 năm kinh nghiệm, Chuyên gia về Hỗ trợ sinh sản và Thụ tinh trong ống nghiệm</li><li>Bác sĩ nhận khám mọi độ tuổi</li></ul><h5>Khám và điều trị</h5><h6>Hiếm muộn – Hỗ trợ sinh sản (Fertility – ART):</h6><ul><li>Kiểm tra sức khỏe sinh sản; tư vấn kế hoạch thụ thai thành công</li><li>Khám, điều trị, các bệnh lý vô sinh cho cả Nam và Nữ</li><li>Vô sinh nam: không tinh trùng; tinh trùng ít, chết, dị dạng; không ống dẫn tinh; tắc ống dẫn tinh; rối loạn nội tiết; rối loạn sinh tinh; …</li><li>Vô sinh nữ: rối loạn nội tiết, không phóng noãn, suy buồng trứng sớm, tắc ống dẫn trứng</li><li>Kích thích rụng trứng bằng phác đồ chuẩn, hiện đại, hiệu quả cao nhất</li><li>Thực hiện kỹ thuật Thụ thai nhân tạo (IUI)</li><li>Thực hiện kỹ thuật Thụ tinh ống nghiệm (IVF, ICSI)</li></ul><h6>Quá trình công tác</h6><ul><li>Phó Giám đốc, Trưởng khoa Hỗ trợ Sinh sản Bệnh viện Nam học và Hiếm muộn Hà Nội (2009 - nay)</li><li>Chuyên gia Hỗ trợ sinh sản và Thụ tinh trong ống nghiệm tại Bệnh viện Nam học và Hiếm muộn Hà Nội</li></ul><h6>Quá trình đào tạo</h6><ul><li>Tốt nghiệp Thạc sĩ Học viện Quân y (2011)</li><li>Tốt nghiệp Bác sĩ Đa khoa, Đại học Y khoa Thái Nguyên (2001)</li><li>Tham gia nhiều khóa đào tạo về Hỗ trợ Sinh sản, Thụ tinh trong ống nghiệm tại khoa Y - Đại học Quốc gia Tp. Hồ Chí Minh</li><li>Tham gia các khóa tập huấn trong chương trình hỗ trợ sinh sản của HOSREM và Bệnh viện Từ Dũ.</li><li>Tham dự nhiều khóa học, các hội nghị Quốc tế về IVF tại Châu Âu, Châu Á, Nhật, Mỹ và các nước ASEAN</li></ul>', '##### Thạc sĩ, Bác sĩ Ngọc Mai* Phó Giám đốc, Trưởng khoa Hỗ trợ Sinh sản Bệnh viện Nam học và Hiếm muộn Hà Nội* Hơn 10 năm kinh nghiệm, Chuyên gia về Hỗ trợ sinh sản và Thụ tinh trong ống nghiệm* Bác sĩ nhận khám mọi độ tuổi##### Khám và điều trị###### Hiếm muộn – Hỗ trợ sinh sản (Fertility – ART):* Kiểm tra sức khỏe sinh sản; tư vấn kế hoạch thụ thai thành công* Khám, điều trị, các bệnh lý vô sinh cho cả Nam và Nữ* Vô sinh nam: không tinh trùng; tinh trùng ít, chết, dị dạng; không ống dẫn tinh; tắc ống dẫn tinh; rối loạn nội tiết; rối loạn sinh tinh; …* Vô sinh nữ: rối loạn nội tiết, không phóng noãn, suy buồng trứng sớm, tắc ống dẫn trứng* Kích thích rụng trứng bằng phác đồ chuẩn, hiện đại, hiệu quả cao nhất* Thực hiện kỹ thuật Thụ thai nhân tạo (IUI)* Thực hiện kỹ thuật Thụ tinh ống nghiệm (IVF, ICSI)###### Quá trình công tác* Phó Giám đốc, Trưởng khoa Hỗ trợ Sinh sản Bệnh viện Nam học và Hiếm muộn Hà Nội (2009 - nay)* Chuyên gia Hỗ trợ sinh sản và Thụ tinh trong ống nghiệm tại Bệnh viện Nam học và Hiếm muộn Hà Nội###### Quá trình đào tạo* Tốt nghiệp Thạc sĩ Học viện Quân y (2011)* Tốt nghiệp Bác sĩ Đa khoa, Đại học Y khoa Thái Nguyên (2001)* Tham gia nhiều khóa đào tạo về Hỗ trợ Sinh sản, Thụ tinh trong ống nghiệm tại khoa Y - Đại học Quốc gia Tp. Hồ Chí Minh* Tham gia các khóa tập huấn trong chương trình hỗ trợ sinh sản của HOSREM và Bệnh viện Từ Dũ.* Tham dự nhiều khóa học, các hội nghị Quốc tế về IVF tại Châu Âu, Châu Á, Nhật, Mỹ và các nước ASEAN', 'Phó Giám đốc, Trưởng khoa Hỗ trợ Sinh sản Bệnh viện Nam học và Hiếm muộn Hà NộiHơn 10 năm kinh nghiệm, Chuyên gia về Hỗ trợ sinh sản và Thụ tinh trong ống nghiệmBác sĩ nhận khám mọi độ tuổi ', 4, NULL, NULL, '2024-07-10 14:57:31', '2024-07-10 14:57:31'),
(13, '<h5>Tiến sĩ, Bác sĩ Đức Anh</h5><ul><li>Hơn 10 năm kinh nghiệm khám và điều trị Tai - Mũi - Họng</li><li>Đang công tác tại Bệnh viện Tai - Mũi - Họng TP. Hồ Chí Minh</li><li>Từng học tập và tu nghiệp tại Hoa Kì</li><li>Bác sĩ khám mọi độ tuổi</li></ul><h5>Quá trình công tác</h5><ul><li>Khoa Mũi Xoang, Bệnh viện Tai Mũi Họng TP. Hồ Chí Minh (10/2020 - Nay)</li><li>Khoa Phẫu thuật Đầu Cổ, Bệnh viện Tai Mũi Họng TP. Hồ Chí Minh (11/2018 - 10/2020)</li><li>Khoa Nhi –Tổng Hợp, Bệnh viện Tai Mũi Họng TP. Hồ Chí Minh (09/2014 - 10/2018)</li></ul><h5>Quá trình đào tạo</h5><ul><li>Tiến sĩ chuyên ngành Tai Mũi Họng - Đại học Y Dược TP. Hồ Chí Minh (2017 - 2022)</li><li>Tu nghiệp về chuyên ngành Tai Mũi Họng và Phẫu thuật đầu cổ - Bệnh viện Mayo Clinic, Arizona, Hoa Kỳ (06/2016 - 12/2016)</li><li>Thạc sĩ chuyên ngành Tai Mũi Họng - Đại học Y Dược TP. Hồ Chí Minh (2012 - 2014)</li><li>Bác sĩ đa khoa hệ chính quy - Đại học Y Phạm Ngọc Thạch (2005 - 2011)</li></ul><h5>Chứng chỉ trong nước hoặc nước ngoài</h5><ul><li></li><li>Giáo trình Định hướng Tai mũi họng được đơn Khoa Y – Đại học quốc gia TP. Hồ Chí Minh (2020)</li><li>Đánh giá cải thiện chất lượng giọng của bệnh nhân rối loạn phát âm co thắt thể khép điều trị bằng botulinum toxin A (2020)</li><li>Khảo sát đặc điểm lâm sàng, cận lâm sàng và một số yếu tố liên quan trong chẩn đoán bệnh lý rối loạn phát âm co thắt thể khép (2020)</li><li>Vai trò của sinh thiết tức thì trong phẫu thuật laser vi phẫu qua đường miệng trong điều trị ung thư thanh quản tầng thanh môn giai đoạn sớm tại bệnh viện Tai Mũi Họng Tp. Hồ Chí Minh (2020)</li><li>Kết quả điều trị ung thư thanh quản tầng thanh môn giai đoạn sớm bằng vi phẫu laser CO2 tại bệnh viện Tai Mũi Họng TP. Hồ Chí Minh (2020)</li><li>Tuan Nguyen Thanh, Thuy Tran Phan Chung (2019), &quot;Early Outcomes of Transoral Laser Microsurgery for T1-T2 Oropharyngeal Cancer&quot;, Asian Journal of Pharmaceutical Research and Health Care, tập 10 (4), 104-108 (2019)</li><li>Transoral laser microsurgery in early-stage laryngeal and oropharyngeal cancer/ The 18th ASEAN ORL-HNS Congress 2019 (2019)</li><li>Kết quả bước đầu ứng dụng phẫu thuật laser vi phẫu qua đường miệng trong điều trị ung thư họng miệng giai đoạn sớm (2019)</li><li>Rối loạn phát âm co thắt: đặc điểm lâm sàng và hiệu quả điều trị botulinum toxin a của 24 trường hợp (2019)</li><li>Đánh giá cải thiện chất lượng sống của bệnh nhân rối loạn phát âm co thắt thể khép điều trị bằng abobotulinum toxin (2019)</li><li>Kết quả bước đầu thực hiện kĩ thuật tiêm Botulinum toxin điều trị rối loạn phát âm co thắt thể khép (2018)</li><li>Kết quả bước đầu điều trị ung thư thanh quản tầng thanh môn giai đoạn sớm bằng vi phẫu laser (2018)</li><li>Transoral laser microsurgery for early glottic cancer/ The 4th international conference (2018) Innovations In Cancer Research And Regenerative Medicine (2017)</li><li>Phẫu thuật laser qua đường miệng trong điều trị ung thư thanh quản tầng thanh môn giai đoạn sớm tại Bệnh viện Tai Mũi Họng TP. Hồ Chí Minh (2017)</li><li>Khảo sát các yếu tố nguy cơ ảnh hưởng đến tình trạng lão thính (2015)</li><li>Thành viên các Hội khoa học, tổ chức chuyên môn</li><li>Hội viên Hội Tai Mũi Họng Việt Nam (2017 - Nay)</li><li>Hội viên Hội Tai Mũi Họng TP. Hồ Chí Minh và các tỉnh phía Nam (2015 - Nay)</li></ul>', '##### Tiến sĩ, Bác sĩ Đức Anh* Hơn 10 năm kinh nghiệm khám và điều trị Tai - Mũi - Họng* Đang công tác tại Bệnh viện Tai - Mũi - Họng TP. Hồ Chí Minh* Từng học tập và tu nghiệp tại Hoa Kì* Bác sĩ khám mọi độ tuổi##### Quá trình công tác* Khoa Mũi Xoang, Bệnh viện Tai Mũi Họng TP. Hồ Chí Minh (10/2020 - Nay)* Khoa Phẫu thuật Đầu Cổ, Bệnh viện Tai Mũi Họng TP. Hồ Chí Minh (11/2018 - 10/2020)* Khoa Nhi –Tổng Hợp, Bệnh viện Tai Mũi Họng TP. Hồ Chí Minh (09/2014 - 10/2018)##### Quá trình đào tạo* Tiến sĩ chuyên ngành Tai Mũi Họng - Đại học Y Dược TP. Hồ Chí Minh (2017 - 2022)* Tu nghiệp về chuyên ngành Tai Mũi Họng và Phẫu thuật đầu cổ - Bệnh viện Mayo Clinic, Arizona, Hoa Kỳ (06/2016 - 12/2016)* Thạc sĩ chuyên ngành Tai Mũi Họng - Đại học Y Dược TP. Hồ Chí Minh (2012 - 2014)* Bác sĩ đa khoa hệ chính quy - Đại học Y Phạm Ngọc Thạch (2005 - 2011)##### Chứng chỉ trong nước hoặc nước ngoài** Giáo trình Định hướng Tai mũi họng được đơn Khoa Y – Đại học quốc gia TP. Hồ Chí Minh (2020)* Đánh giá cải thiện chất lượng giọng của bệnh nhân rối loạn phát âm co thắt thể khép điều trị bằng botulinum toxin A (2020)* Khảo sát đặc điểm lâm sàng, cận lâm sàng và một số yếu tố liên quan trong chẩn đoán bệnh lý rối loạn phát âm co thắt thể khép (2020)* Vai trò của sinh thiết tức thì trong phẫu thuật laser vi phẫu qua đường miệng trong điều trị ung thư thanh quản tầng thanh môn giai đoạn sớm tại bệnh viện Tai Mũi Họng Tp. Hồ Chí Minh (2020)* Kết quả điều trị ung thư thanh quản tầng thanh môn giai đoạn sớm bằng vi phẫu laser CO2 tại bệnh viện Tai Mũi Họng TP. Hồ Chí Minh (2020)* Tuan Nguyen Thanh, Thuy Tran Phan Chung (2019), Early Outcomes of Transoral Laser Microsurgery for T1-T2 Oropharyngeal Cancer, Asian Journal of Pharmaceutical Research and Health Care, tập 10 (4), 104-108 (2019)* Transoral laser microsurgery in early-stage laryngeal and oropharyngeal cancer/ The 18th ASEAN ORL-HNS Congress 2019 (2019)* Kết quả bước đầu ứng dụng phẫu thuật laser vi phẫu qua đường miệng trong điều trị ung thư họng miệng giai đoạn sớm (2019)* Rối loạn phát âm co thắt: đặc điểm lâm sàng và hiệu quả điều trị botulinum toxin a của 24 trường hợp (2019)* Đánh giá cải thiện chất lượng sống của bệnh nhân rối loạn phát âm co thắt thể khép điều trị bằng abobotulinum toxin (2019)* Kết quả bước đầu thực hiện kĩ thuật tiêm Botulinum toxin điều trị rối loạn phát âm co thắt thể khép (2018)* Kết quả bước đầu điều trị ung thư thanh quản tầng thanh môn giai đoạn sớm bằng vi phẫu laser (2018)* Transoral laser microsurgery for early glottic cancer/ The 4th international conference (2018) Innovations In Cancer Research And Regenerative Medicine (2017)* Phẫu thuật laser qua đường miệng trong điều trị ung thư thanh quản tầng thanh môn giai đoạn sớm tại Bệnh viện Tai Mũi Họng TP. Hồ Chí Minh (2017)* Khảo sát các yếu tố nguy cơ ảnh hưởng đến tình trạng lão thính (2015)* Thành viên các Hội khoa học, tổ chức chuyên môn* Hội viên Hội Tai Mũi Họng Việt Nam (2017 - Nay)* Hội viên Hội Tai Mũi Họng TP. Hồ Chí Minh và các tỉnh phía Nam (2015 - Nay)', 'Hơn 10 năm kinh nghiệm khám và điều trị Tai - Mũi - HọngĐang công tác tại Bệnh viện Tai - Mũi - Họng TP. Hồ Chí MinhTừng học tập và tu nghiệp tại Hoa Kì', 3, NULL, NULL, '2024-07-10 15:09:41', '2024-07-10 15:09:41'),
(14, '<h5>Tiến sĩ, Bác sĩ Xuân Hiệp</h5><ul><li>Hiện là Phó viện trưởng Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai</li><li>Nguyên Trưởng phòng Thăm dò chức năng</li><li>Nguyên Phó trưởng phòng Tư vấn và Điều trị ngoại trú</li><li>Tốt nghiệp bác sĩ Nội trú bệnh viện, Chuyên ngành Tâm thần</li><li>Bác sĩ khám cho người bệnh từ 6 tuổi trở lên</li><li>Bác sĩ không nhận tư vấn tâm lý</li></ul><h5>Quá trình đào tạo</h5><ul><li>Bác sỹ Đa Khoa, Đại học Y Hà Nội (1996 – 2002)</li><li>Hoàn thành lớp chuyên khoa định hướng Chuyên ngành Tâm thần (2002 – 2003)</li><li>Tốt nghiệp bác sỹ Nội trú bệnh viện, Chuyên ngành Tâm thần (2003 – 2006)</li></ul><h5>Quá trình công tác</h5><ul><li>Bác sỹ điều trị, Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai (2/2007 – 2009)</li><li>Trưởng phòng Thăm dò chức năng, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2009 – 2011)</li><li>Phó trưởng phòng Tư vấn và Điều trị ngoại trú, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2011 – 2015)</li><li>Phó trưởng Phòng Điều trị Tâm thần Nhi và Người già, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2015 – 5/2017)</li><li>Trưởng phòng Điều trị Tâm thần người già, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (6/2017 đến nay)</li></ul><h5>Thành viên các Hội khoa học, tổ chức chuyên môn</h5><ul><li>Thành viên Hội Tâm thần học Việt Nam</li></ul><h5>Lưu ý:</h5><ul><li>Hiện tại Phòng khám chưa chia giờ chính xác cho bệnh nhân, bệnh nhân nào tới trước sẽ khám trước.</li><li>Thời gian bác sĩ nhận bệnh nhân: Sáng từ 9h đến 11h; chiều từ 16h45 đến 19h</li></ul><h5>Khám, tư vấn, và điều trị</h5><ul><li>Mất ngủ</li><li>Suy giảm nhận thức và sa sút trí tuệ ở người cao tuổi</li><li>Rối loạn giấc ngủ</li><li>Rối loạn liên quan stress, căng thẳng</li><li>Rối loạn cảm xúc và hành vi ở trẻ em và thanh thiếu niên</li><li>Rối loạn tâm thần người trưởng thành</li><li>Trầm cảm</li><li>Rối loạn lo âu</li><li>Rối loạn lưỡng cực</li><li>Rối loạn cảm xúc khác</li><li>Rối loạn căng thẳng sau chấn thương tâm lý</li><li>Bệnh hoang tưởng</li><li>Rối loạn ám ảnh</li><li>Rối loạn dạng cơ thể</li><li>Tâm thần phân liệt</li><li>Một số triệu chứng, biểu hiện sau:</li><li>Ảo giác, hoang tưởng</li><li>Bi quan, buồn rầu</li><li>Đập phá đồ đạc</li><li>Hành vi hung hăng</li><li>Hay tức giận</li><li>Hoảng hốt</li><li>Khó tập trung tâm trí</li><li>Khóc cười vô cớ</li><li>Kích động</li><li>Lo âu, lo lắng</li><li>Mất tập trung</li><li>Nghiện ngập rượu, ma túy, nghiện game, nghiện internet</li><li>Nhầm lẫn tư duy</li><li>Nói cười một mình</li><li>Rối loạn giấc ngủ</li><li>Sợ hãi, sợ một mình, sợ đông người</li><li>Tuyệt vọng, suy nghĩ tự sát</li><li>Trầm cảm</li><li>Xa lánh mọi người</li><li>Ý nghĩ kì lạ</li><li>Stress</li><li>Rối loạn lo âu</li><li>Suy giảm trí nhớ</li><li>Đau, rối loạn dạ dày ruột, rối loạn nhịp tim… lặp đi lặp lại nhiều lần mà không xét nghiệm thấy tổn thương tương ứng</li></ul>', '##### Tiến sĩ, Bác sĩ Xuân Hiệp* Hiện là Phó viện trưởng Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai* Nguyên Trưởng phòng Thăm dò chức năng* Nguyên Phó trưởng phòng Tư vấn và Điều trị ngoại trú* Tốt nghiệp bác sĩ Nội trú bệnh viện, Chuyên ngành Tâm thần* Bác sĩ khám cho người bệnh từ 6 tuổi trở lên* Bác sĩ không nhận tư vấn tâm lý##### Quá trình đào tạo* Bác sỹ Đa Khoa, Đại học Y Hà Nội (1996 – 2002)* Hoàn thành lớp chuyên khoa định hướng Chuyên ngành Tâm thần (2002 – 2003)* Tốt nghiệp bác sỹ Nội trú bệnh viện, Chuyên ngành Tâm thần (2003 – 2006)##### Quá trình công tác* Bác sỹ điều trị, Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai (2/2007 – 2009)* Trưởng phòng Thăm dò chức năng, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2009 – 2011)* Phó trưởng phòng Tư vấn và Điều trị ngoại trú, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2011 – 2015)* Phó trưởng Phòng Điều trị Tâm thần Nhi và Người già, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2015 – 5/2017)* Trưởng phòng Điều trị Tâm thần người già, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (6/2017 đến nay)##### Thành viên các Hội khoa học, tổ chức chuyên môn* Thành viên Hội Tâm thần học Việt Nam##### Lưu ý:* Hiện tại Phòng khám chưa chia giờ chính xác cho bệnh nhân, bệnh nhân nào tới trước sẽ khám trước.* Thời gian bác sĩ nhận bệnh nhân: Sáng từ 9h đến 11h; chiều từ 16h45 đến 19h##### Khám, tư vấn, và điều trị* Mất ngủ* Suy giảm nhận thức và sa sút trí tuệ ở người cao tuổi * Rối loạn giấc ngủ* Rối loạn liên quan stress, căng thẳng* Rối loạn cảm xúc và hành vi ở trẻ em và thanh thiếu niên* Rối loạn tâm thần người trưởng thành* Trầm cảm* Rối loạn lo âu * Rối loạn lưỡng cực * Rối loạn cảm xúc khác* Rối loạn căng thẳng sau chấn thương tâm lý * Bệnh hoang tưởng* Rối loạn ám ảnh* Rối loạn dạng cơ thể* Tâm thần phân liệt* Một số triệu chứng, biểu hiện sau:* Ảo giác, hoang tưởng * Bi quan, buồn rầu * Đập phá đồ đạc* Hành vi hung hăng* Hay tức giận* Hoảng hốt* Khó tập trung tâm trí* Khóc cười vô cớ* Kích động* Lo âu, lo lắng * Mất tập trung* Nghiện ngập rượu, ma túy, nghiện game, nghiện internet* Nhầm lẫn tư duy* Nói cười một mình* Rối loạn giấc ngủ* Sợ hãi, sợ một mình, sợ đông người* Tuyệt vọng, suy nghĩ tự sát* Trầm cảm* Xa lánh mọi người* Ý nghĩ kì lạ * Stress* Rối loạn lo âu* Suy giảm trí nhớ* Đau, rối loạn dạ dày ruột, rối loạn nhịp tim… lặp đi lặp lại nhiều lần mà không xét nghiệm thấy tổn thương tương ứng', 'Hiện là Phó viện trưởng Viện sức khoẻ Tâm thần, Bệnh viện Bạch MaiThành viên Hội Tâm thần học Việt NamBác sĩ khám cho người bệnh từ 6 tuổi trở lênBác sĩ không nhận tư vấn tâm lý', 2, NULL, NULL, '2024-07-10 15:13:45', '2024-07-10 15:13:45');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(2, 'data:image/png;base64,', 'Cơ Xương Khớp', '<h5>Cơ Xương Khớp</h5><h6>Bác sĩ Cơ Xương Khớp giỏi</h6><p>Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</p><ul><li>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</li><li>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</li><li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.</li><li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li></ul><h6>Bệnh Cơ Xương Khớp</h6><ul><li>Gout</li><li>Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ</li><li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li><li>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</li><li>Loãng xương, đau nhức xương</li><li>Viêm xương, gai xương</li><li>Viêm cơ, Teo cơ, chứng đau mỏi cơ</li><li>Yếu cơ, Loạn dưỡng cơ</li><li>Các chấn thương về cơ, xương, khớp</li><li>...</li></ul>', '##### Cơ Xương Khớp###### Bác sĩ Cơ Xương Khớp giỏiDanh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:* Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm* Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...###### Bệnh Cơ Xương Khớp* Gout* Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ* Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân* Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai* Loãng xương, đau nhức xương* Viêm xương, gai xương* Viêm cơ, Teo cơ, chứng đau mỏi cơ* Yếu cơ, Loạn dưỡng cơ* Các chấn thương về cơ, xương, khớp* ...', '2024-07-13 18:54:53', '2024-07-13 18:54:53');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(3, 'data:image/png;base64,', 'Thần Kinh', '<h5>Thần kinh</h5><h6>Bác sĩ Thần kinh giỏi</h6><p>Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</p><ul><li>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.</li><li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</li></ul><h5>Khám bệnh chuyên khoa Thần kinh</h5><ul><li>Bại Não</li><li>Đau đầu, chóng mặt, buồn nôn</li><li>Bệnh Pakison, bệnh tiền đình</li><li>Bị co cơ, căng dây thần kinh</li><li>Động kinh, có những cơn vãng ý thức</li><li>Bị tê bì nửa mặt, chèn dây thần kinh</li><li>Bồn chồn, lo lắng, hồi hộp, chân tay run</li><li>Có dấu hiệu tăng động</li><li>Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi</li><li>Chấn thương đầu, dây thần kinh</li><li>...</li></ul>', '##### Thần kinh\r\r\r###### Bác sĩ Thần kinh giỏi\r\rDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:\r\r* Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.\r* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...\r* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\r\r\r##### Khám bệnh chuyên khoa Thần kinh\r\r* Bại Não	   \r* Đau đầu, chóng mặt, buồn nôn   \r* Bệnh Pakison, bệnh tiền đình	   \r* Bị co cơ, căng dây thần kinh	       \r* Động kinh, có những cơn vãng ý thức	   \r* Bị tê bì nửa mặt, chèn dây thần kinh\r* Bồn chồn, lo lắng, hồi hộp, chân tay run	   \r* Có dấu hiệu tăng động	    \r* Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi   \r* Chấn thương đầu, dây thần kinh\r* ...', '2024-07-13 20:59:46', '2024-07-13 20:59:46');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(4, 'data:image/png;base64,', 'Tiêu Hoá', '<h5>Tiêu hoá</h5><h6>Bác sĩ Chuyên khoa Tiêu hóa</h6><p>Danh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</p><ul><li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội</li><li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li><li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</li></ul><h6>Tư vấn, khám và điều trị các Bệnh Tiêu hóa</h6><ul><li>Ăn uống kém, không ngon</li><li>Rối loạn tiêu hóa, táo bón, trĩ</li><li>Nhiễm vi khuẩn HP (Helicobacter pylori)</li><li>Nội soi dạ dày, đại tràng, tiêu hóa</li><li>Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi</li><li>Co thắt thực quản, Hội chứng ruột kích thích</li><li>Đau bụng, dạ dày, đại tràng, thượng vị</li><li>Viêm đại tràng, dạ dày, tá tràng</li><li>Ung thư dạ dày, U nang tuyến tụy</li><li>Bệnh lý về gan, mật</li><li>...</li></ul>', '##### Tiêu hoá\r\r\r###### Bác sĩ Chuyên khoa Tiêu hóa\r\rDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:\r\r* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\r* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\r* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\r* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\r\r###### Tư vấn, khám và điều trị các Bệnh Tiêu hóa\r\r\r* Ăn uống kém, không ngon\r* Rối loạn tiêu hóa, táo bón, trĩ\r* Nhiễm vi khuẩn HP (Helicobacter pylori)\r* Nội soi dạ dày, đại tràng, tiêu hóa\r* Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\r* Co thắt thực quản, Hội chứng ruột kích thích\r* Đau bụng, dạ dày, đại tràng, thượng vị\r* Viêm đại tràng, dạ dày, tá tràng\r* Ung thư dạ dày, U nang tuyến tụy\r* Bệnh lý về gan, mật\r* ...', '2024-07-13 21:02:07', '2024-07-13 21:02:07');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(5, 'data:image/png;base64,', 'Tim Mạch', '<h5>Tim mạch</h5><h6>Bác sĩ tim mạch giỏi</h6><p>Danh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p><ul><li>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.</li><li>Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội</li><li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội</li><li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam</li><li>Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li></ul><h6>Khám tư vấn tim mạch</h6><ul><li>Khó thở, Đau ngực, đau tim</li><li>Tăng huyết áp, hạ huyết áp</li><li>Rối loạn mỡ máu, cao huyết áp, chóng mặt</li><li>Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ</li><li>Cảm giác hồi hộp, tim đập nhanh</li><li>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến</li><li>Đã đặt stent tim, nong động mạch vành</li><li>Giãn tĩnh mạch chân</li><li>...</li></ul>', '##### Tim mạch\r\r\r###### Bác sĩ tim mạch giỏi\r\rDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:\r\r* Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\r* Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\r* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\r* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\r* Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\r\r###### Khám tư vấn tim mạch\r\r\r* Khó thở, Đau ngực, đau tim\r* Tăng huyết áp, hạ huyết áp\r* Rối loạn mỡ máu, cao huyết áp, chóng mặt\r* Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\r* Cảm giác hồi hộp, tim đập nhanh	   \r* Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến	   \r* Đã đặt stent tim, nong động mạch vành\r* Giãn tĩnh mạch chân\r* ...', '2024-07-13 21:06:09', '2024-07-13 21:06:09');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(6, 'data:image/png;base64,', 'Tai Mũi Họng', '<h5>Tai Mũi Họng</h5><h6>Bác sĩ Chuyên khoa Tai Mũi Họng</h6><h6>Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:</h6><ul><li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội</li><li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li><li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...</li></ul><h6>Các bệnh Tai Mũi Họng</h6><ul><li>Ù tai, đau tai, chảy máu tai</li><li>Thủng màng nhĩ, điếc đột ngột</li><li>Viêm tai giữa</li><li>Amidan, V.A</li><li>Viêm xoang</li><li>Nghẹt mũi</li><li>Hay bị chảy máu cam</li><li>Đau cổ họng, khó nuốt</li><li>Ho kéo dài</li><li>Ngủ ngáy</li><li>...</li></ul>', '##### Tai Mũi Họng###### Bác sĩ Chuyên khoa Tai Mũi Họng###### Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...###### Các bệnh Tai Mũi Họng* Ù tai, đau tai, chảy máu tai* Thủng màng nhĩ, điếc đột ngột* Viêm tai giữa* Amidan, V.A* Viêm xoang* Nghẹt mũi* Hay bị chảy máu cam* Đau cổ họng, khó nuốt* Ho kéo dài* Ngủ ngáy* ...', '2024-07-14 09:08:14', '2024-07-14 09:08:14');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(7, 'data:image/png;base64,', 'Cột Sống', '<h5>Cột sống</h5><h6>Bác sĩ Chuyên khoa Cột sống</h6><p>Danh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.</p><ul><li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội</li><li>Các giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.</li><li>Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li></ul><h6>Bệnh Thần kinh - Cột sống</h6><ul><li>Đau cột sống, đau thắt lưng</li><li>Chấn thương cột sống</li><li>Cột sống bị đau, sưng, cong, vẹo</li><li>Đau mỏi cổ vai gáy, bả vai</li><li>Đau tê mông xuống chân</li><li>Phồng đĩa đệm</li><li>Tê bì tay chân</li><li>Thóa hóa đốt sống</li><li>Thoái hóa L4, L5</li><li>Thoát vị đĩa đệm</li><li>Vôi hóa cột sống</li><li>Xẹp cột sống</li><li>...</li></ul>', '##### Cột sống\r\r\r###### Bác sĩ Chuyên khoa Cột sống\r\rDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.\r\r* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội\r* Các giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.\r* Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...\r* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\r\r###### Bệnh Thần kinh - Cột sống\r\r\r* Đau cột sống, đau thắt lưng\r* Chấn thương cột sống\r* Cột sống bị đau, sưng, cong, vẹo\r* Đau mỏi cổ vai gáy, bả vai\r* Đau tê mông xuống chân\r* Phồng đĩa đệm\r* Tê bì tay chân\r* Thóa hóa đốt sống\r* Thoái hóa L4, L5\r* Thoát vị đĩa đệm\r* Vôi hóa cột sống\r* Xẹp cột sống\r* ...', '2024-07-14 09:10:17', '2024-07-14 09:10:17');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(8, 'data:image/png;base64,', 'Y Học Cổ Truyền', '<h5>Y học Cổ truyền</h5><h6>Bác sĩ Y học Cổ truyền giỏi</h6><p>Danh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p><ul><li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</li><li>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</li></ul><h6>Tư vấn, khám và điều trị các vấn đề:</h6><ul><li>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</li><li>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</li><li>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</li><li>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</li></ul>', '##### Y học Cổ truyền\r\r\r###### Bác sĩ Y học Cổ truyền giỏi\r\rDanh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\r* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\r* Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\r* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\r\r\r###### Tư vấn, khám và điều trị các vấn đề:\r\r\r* Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\r* Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\r* Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\r* Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', '2024-07-14 09:11:38', '2024-07-14 09:11:38'),
(9, 'data:image/png;base64,', 'Châm Cứu', '<h5>Châm cứu</h5><h6>Bác sĩ Châm cứu giỏi</h6><p>Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p><ul><li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</li><li>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</li></ul><h6>Tư vấn, khám và điều trị các vấn đề:</h6><ul><li>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</li><li>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</li><li>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</li><li>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</li></ul>', '##### Châm cứu\r\r\r###### Bác sĩ Châm cứu giỏi\r\r\rBác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\r\r* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\r* Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\r* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\r\r\r###### Tư vấn, khám và điều trị các vấn đề:\r\r\r* Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\r* Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\r* Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\r* Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', '2024-07-14 09:13:18', '2024-07-14 09:13:18');
